Congratulations on an iNat first! I have made your image the taxon photo.

As the former creator/publisher of the online resource <b>THE WORLD OF <em>ATHERIS</em>: An Online Guide to the Vipers of the Tribe Atherini</b>, this is one of my favorite iNat *firsts*! Sadly, my website ran from the 90s to about 2007? but is no longer in cyberspace. 

This interesting monotypic species almost took the life of Dwight Lawson, my old internet friend, and contributor to <b>The World of <em>Atheris<em></b>. I published an account of his experience on the site.

Cheers!

@tiwane  - Tony, I nominate this "first" for an Observation of the Day post.

@bobbyfingers @wolfgang_wuster
